import logo from './logo.svg';
import './App.css';

function App() {
  const value = 3;
  return (
    <div className="App">
      {
        (function() {
          if (value===1) return (<div>하나</div>)
          else if (value===2) return (<div>둘</div>)
          else if (value===3) return (<div>셋</div>)
        })
      }
    </div>
  );
}

export default App;

